import React from 'react';

function Contact() {
  return (
    <section className="contact">
      <h2>Contact Us</h2>
      <p>Email: info@kmvaluers.com</p>
      <p>Phone: +91-1234567890</p>
    </section>
  );
}

export default Contact;
